import s from './Card.module.css'

export default function Card(props) {
   return (
      <div className='cardContainer'>
         <button onClick={props.onClose}>X</button>
         <h2 className='Name'>{props.name}</h2>
         <h2>{props.species} </h2>
         <h2>{props.gender} </h2>
         <img  src={props.image} alt="img" />
      </div>
   );
}
